INSERT INTO `hk_forum_posts` VALUES (84, '000000', 1, 0, 1, 5, 1657932533410680800, '收到回复是，的划分收快递见风使舵', '', '', '[{\"url\":\"https://hk-uploadfiles.oss-cn-hangzhou.aliyuncs.com/test/uploads/2023-06-14/u=3069651952,3707858927&fm=193&f=GIF.jpg\"}]', '', 2, '', '<p><br></p><p><br></p><p><br></p><p><br></p><p>寒英煮绿尘&nbsp;</p><p>|</p><p>手机版</p><p>|</p><p>我的生词本</p><p>下载百度汉语App</p><p>名师好课免费看</p><p><br></p><p>拼 音&nbsp;ā&nbsp;&nbsp;&nbsp;a&nbsp;&nbsp;&nbsp;ǎ&nbsp;&nbsp;&nbsp;á&nbsp;&nbsp;&nbsp;à&nbsp;&nbsp;</p><p>部 首&nbsp;口&nbsp;笔 画&nbsp;10&nbsp;五 行&nbsp;土&nbsp;繁 体&nbsp;啊&nbsp;五 笔&nbsp;KBSK</p><p>生词本</p><p>基本释义&nbsp;详细释义</p><p>[&nbsp;ā&nbsp;]</p><p>助词。置于语尾，无义。&nbsp;&nbsp;【组词】：不错啊！</p><p>[&nbsp;a&nbsp;]</p><p>助词。置于语尾，无义。不错啊！</p><p>[&nbsp;ǎ&nbsp;]</p><p>表示惊疑：～?怎么会有这种事?</p><p>[&nbsp;á&nbsp;]</p><p>表示追问：～?你明天到底去不去呀?～?你说什么?</p><p>[&nbsp;à&nbsp;]</p><p>1.表示应诺（音较短）：～，好吧。</p><p>2.表示明白过来（音较长）：～，原来是你，怪不得看着面熟哇!</p><p>3.表示赞叹或惊异（音较长）：～，伟大的祖国!～， 真没想到他会取得这么好的成绩!</p><p>啊的笔顺</p><p><br></p><p>1&nbsp;丨</p><p>竖</p><p><br></p><p>2&nbsp;𠃍</p><p>横折</p><p><br></p><p>3&nbsp;一</p><p>横</p><p><br></p><p>4&nbsp;㇌</p><p>横折折折钩/横撇弯钩</p><p><br></p><p>5&nbsp;丨</p><p>竖</p><p><br></p><p>6&nbsp;一</p><p>横</p><p><br></p><p>7&nbsp;丨</p><p>竖</p><p><br></p><p>8&nbsp;𠃍</p><p>横折</p><p><br></p><p>9&nbsp;一</p><p>横</p><p><br></p><p>10&nbsp;亅</p><p>竖钩</p><p>相关组词</p><p>啊呀&nbsp;嗯啊&nbsp;啊唷&nbsp;啊哟&nbsp;啾啊&nbsp;啊达&nbsp;啊叼&nbsp;么啊&nbsp;啊捏&nbsp;啊哈&nbsp;啊哥哩</p><p>百科释义</p><p>报错</p><p>	拼音[ā；á；ǎ；à] 助词，在句末，表示感叹，惊叹，惊讶，疼痛的语气（常因前面字音不同而发生变音，可用不同的字来表示）。如：你好～（哇）！ 真新鲜～（哪）。这个植物真奇特～（呀）！&nbsp;查看百科</p><p>注：百科释义来自于百度百科，由网友自行编辑。</p><p>相关字</p><p><br></p><p>别</p><p>&nbsp;</p><p>可</p><p>&nbsp;</p><p>合</p><p>&nbsp;</p><p>同</p><p>&nbsp;</p><p>后</p><p>&nbsp;</p><p>向</p><p>热搜字</p><p><br></p><p>伊</p><p>&nbsp;</p><p>冲</p><p>&nbsp;</p><p>几</p><p>&nbsp;</p><p>华</p><p>&nbsp;</p><p>吮</p><p>&nbsp;</p><p>嗯</p><p>© Baidu&nbsp;使用百度前必读&nbsp;百度首页&nbsp;问题反馈&nbsp;商务合作&nbsp;关注微博</p>', '', '', '', 0, 0, 0, 0, 2, 0, 0, 0, 0, 0, 0, NULL, 3, 1, 0, 0, 0, 0, 0, 0, 0, '', '', NULL, NULL, 0, 0, 0, 0, '', 1, '2023-06-14 16:00:20.373', '2023-06-15 10:48:55.784', NULL, NULL, NULL, NULL, 0, 0);
